import { get } from "./httpInterceptor";

export const getAllLaunchList = (year = "", landing = false, launch = true) => {
  let url = `/v3/launches?limit=100`;
  if (year) {
    url = url + `&launch_year=${year}`;
  } else if (landing) {
    url =url +`&land_success=${landing}`
  } else if (launch) {
      url =url +`&launch_success=${launch}`
  }

  return get(`/v3/launches?limit=100`).then((res) => {
    return res;
  });
};
